def attackUpdate(queens,dp,dm,attacked):
    lst = []
    cal = lambda y: (y - 1 if y != 0 else 0)
    digit = len(str(len(queens)))
    lev = int(10**(digit+1))
    for row, col in enumerate(queens):
        plus, minus = row + col, row - col + len(queens) - 1
        if dp[plus] > 1 or dm[minus] > 1:
            lst.append(row + lev *(cal(dp[plus]) +cal(dm[minus])))
    lst.sort()
    lst = list(map(lambda x : x % lev, lst))
    return lst

